import React from 'react';

class ButtonClass extends React.Component{
    handleClick = () =>{
        this.props.onClick();
    }

    render(){
        return(
            <button onClick={this.handleClick}>
                {this.props.label}
            </button>
        );
    }
}

export default ButtonClass;
